import React from 'react';
import { Link } from 'react-router-dom';

function ImagesPage({ images }) {
  return (
    <div>
      <h1>Images Page</h1>
      {images.map((image) => (
        <div key={image.id}>
          <Link to={`/image/${image.id}`}>
            <img src={image.url} alt="Uploaded" />
          </Link>
        </div>
      ))}
    </div>
  );
}

export default ImagesPage;
